import React from "react";

const Footer = () => {
  return (
    <div className="extLinks">
      {/* THIS IS THE CONTAINER FOR THE FOOTER LINKS */}
      <nav>Home</nav>
      <nav>Blog</nav>
      <nav>Jobs</nav>
      <nav>Help</nav>
      <nav>API</nav>
      <nav>Privacy</nav>
      <nav>Terms</nav>
      <nav>Top Accounts</nav>
      <nav>Hashtags</nav>
      <nav>Locations</nav>
      <nav>Beauty</nav>
      <nav>Dance and Performance</nav>
      <nav>Fitness</nav>
      <nav>Food and Drink</nav>
      <nav>Home and Garden</nav>
      <nav>Music</nav>
      <nav>Visual Arts</nav>
      <div>
        {/* English drop down */}
        <p>2020 Instagram from Facebook</p>
      </div>
    </div>
  );
};

export default Footer;
